import React from 'react';

const SignIn = ({username, password}) => {

    return (
        <div className="SignInForm">
            <form>
                <label>Username
                <input
                name='username'
                type='text'
                value={username}
                ></input>
                </label>
                <label>Password
                <input></input>
                </label>

            </form>
        </div>
    )
}

export default SignIn;
